const e=JSON.parse('{"key":"v-d4e69870","path":"/Framework/vite03.html","title":"vite proxy 代理","lang":"zh-CN","frontmatter":{"title":"vite proxy 代理","icon":"build","date":"2023-09-23T00:00:00.000Z","category":["框架"],"tag":["vite"],"sticky":false},"headers":[{"level":2,"title":"添加代理访问的真实地址","slug":"添加代理访问的真实地址","link":"#添加代理访问的真实地址","children":[]},{"level":2,"title":"参考","slug":"参考","link":"#参考","children":[]}],"git":{"createdTime":1695737041000,"updatedTime":1697345532000,"contributors":[{"name":"rayadaschn","email":"115447518+rayadaschn@users.noreply.github.com","commits":2}]},"readingTime":{"minutes":4,"words":1199},"filePathRelative":"Framework/vite03.md","localizedDate":"2023年9月23日","excerpt":"<p>给 Vite Proxy 代理添加响应头。</p>\\n<p>vite 的 proxy 代理同 webpack 类型，在 <code>server.proxy</code> 下进行:</p>\\n<p>类型为： <code>Record&lt;string, string | ProxyOptions&gt;</code>，意思是期望接收一个 { key: options } 对象。任何请求路径以 key 值开头的请求将被代理到对应的目标。如果 key 值以 <code>^</code> 开头，将被识别为 RegExp。<code>configure</code> 选项可用于访问 proxy 实例。</p>"}');export{e as data};
